      const data = await response.json();
      setTeam(data);
      console.log(data);
    };

    fetchMatches();


  },[]
);

  return (
    <div className="TeamPage">
    <h1>{team.teamName}</h1>
    <MatchDetailCard />
    {team.matches.map(match => <MatchSmallCard match={match}/>)}
    </div>
  );
}
